import { useEffect } from "react"
import { useDispatch, useSelector } from "react-redux"
import { getTodo } from "../redux/productReducer/action"


function Home(){

    const store = useSelector((data)=>data.productReducer)
    const dispatch = useDispatch()

    console.log(store)

    useEffect(()=>{
        dispatch(getTodo)
    },[])

    return(
        <h1>Products</h1>

    )

}

export default Home
